import { Button,Card } from "antd";

const PostCard = () => {
    return(
        <div>
            <Card>
                <Image/>
                <Content/>
                <Button></Button>
            </Card>
            <CommendForm/>
            <Comments/>
        </div>
    );
};

export default PostCard;
